import Header from "../component/Header";
import Popular from "../component/Popular";
import Article from "../component/Article";
const Home = () => {
  return (
    <main>
      <Header></Header>
      <Popular></Popular>
      <div className="card">
        <h3 className="card__title card__title--center">NeFT features</h3>
        <Article></Article>
      </div>
    </main>
  );
};

export default Home;
